import React from "react";
import {useLocation} from 'react-router-dom'
function useQuery() {
    const { search } = useLocation();

    return React.useMemo(() => new URLSearchParams(search), [search]);
  }
export default  function CompareFish(props){
    let fishAId=parseInt(useQuery().get('fishA'));
    let fishBId=parseInt(useQuery().get('fishB'));
    let fishA=props.object.state.allFish.filter(ele=>ele.id===fishAId)[0];
    let fishB=props.object.state.allFish.filter(ele=>ele.id===fishBId)[0];
    console.log(fishA,fishB)
    const Fish=(fish)=>(
    <article>
             <h1>Name:<span>{fish['file-name']}</span></h1>
            <h2> ID: <span> {fish.id}</span></h2>
            <h2> Selling Price: </h2>
            <h3> Tom Nook's Cranny Shop: <span> {fish.price} </span> </h3>
            <h3> CJ: <span> {fish['price-cj']} </span> </h3>
            <h3> Location/Weather: <span> {fish.location} </span> </h3>
            <h3> Time of Day: <span> {fish['time-array']} </span> </h3>
            <h3> Shadow Size: <span> {fish.shadow} </span> </h3>
            <h3>Rarity: <span> {fish.rarity} </span> </h3>
            <h3> Season: <span> {fish['month-array-northern'], props.fsh['month-array-southern']} </span> </h3> 

    </article>
    );
    return (
    <section>
         <Fish/>
         <Fish/>

    </section>);

}
